x-codeSamples.source:
curl --location --globoff 'https://api.clarifai.com/v2/users/{user_id}/apps/{app_id}/models/{model_id}/versions' \
--header 'Authorization: Bearer YOUR_PERSONAL_ACCESS_TOKEN' \
--header 'Accept: application/json' \
--header 'Content-Type: application/json' \
--data '{
  "model_versions": [
    {
      "output_info": {
        "params": {
          "min_score": 0.7,
          "max_results": 5,
          "prompt_template": "Context information is below:\n{data.hits}\nGiven the context information and not prior knowledge, answer the query.\nQuery: {data.text.raw}\nAnswer: "
        }
      }
    }
  ]
}'

