                    "default_value": "# Example code to geotag image inputs\n# If you're sending this using JSON, you must replace newlines with '\\n'\nfrom clarifai_grpc.grpc.api import resources_pb2, service_pb2\nfrom clarifai_grpc.grpc.api.status import status_code_pb2, status_pb2\nfrom google.protobuf.json_format import MessageToDict, ParseDict\n\n# Define commonly used constants outside functions to increase performance.\nNYC_LAT, NYC_LON = 40.7128, 74.0060\nNYC_GEO_POINT = resources_pb2.GeoPoint(latitude=NYC_LAT, longitude=NYC_LON)\n\n# checks if the input contained an image\ndef validate_image_is_present(image_pbf, input_id):\n    if image_pbf.ByteSize() == 0: # image is not set\n        err_status = status_pb2.Status(code=status_code_pb2.INPUT_INVALID_ARGUMENT,\n            description=f'No Image Received for Input with ID {input_id}')\n        err_resp = service_pb2.MultiOutputResponse(status=err_status)\n        return err_resp\n    return\n\n\n# extract inputs to operator from request, and report error if none are present.\ndef get_inputs_from_req(req):\n    req_inputs = req.get('inputs', None)\n    if not req_inputs:\n      err_status = status_pb2.Status(code=status_code_pb2.INPUT_INVALID_ARGUMENT,\n        description='No Inputs Received')\n      err_resp = service_pb2.MultiOutputResponse(status=err_status)\n      return None, err_resp\n    return req_inputs, None\n\n# add a geo-tag to the data if it contains an image, if no image is present return error.\ndef build_geotagged_image_from_input_image(input_pbf):\n    data_pbf = input_pbf.data\n    image_pbf = data_pbf.image\n    input_id = input_pbf.id # id is just a string\n    # verify there is an image to geo-tag\n    err_resp = validate_image_is_present(image_pbf, input_id)\n    if err_resp != None:\n      return None, err_resp\n    req_output = resources_pb2.Output(id=input_id) # we must forward the ID, otherwise errors will occur.\n    # Here, we copy the original data, which includes the input image to tag, into the output.\n    req_output.data.CopyFrom(data_pbf)\n    # Now, we add a geo-tag to the input.\n    req_output.data.geo.geo_point.CopyFrom(NYC_GEO_POINT)\n\n    return req_output, None\n\ndef main(req):\n  inputs, err_resp = get_inputs_from_req(req)\n  if err_resp != None:\n      return MessageToDict(err_resp, preserving_proto_field_name=True)\n  resp_outputs = []\n  for inp in inputs:\n      input_pbf = ParseDict(inp, resources_pb2.Input())\n      output, err_resp = build_geotagged_image_from_input_image(input_pbf)\n      if err_resp != None:\n          return MessageToDict(err_resp, preserving_proto_field_name=True)\n      resp_outputs.append(output)\n  resp = service_pb2.MultiOutputResponse(outputs=resp_outputs,\n    status=status_pb2.Status(code=status_code_pb2.SUCCESS)) # expected format of the response\n  return MessageToDict(resp, preserving_proto_field_name=True)\n",
